import React from 'react';
function ListaActores(props) {

  

 
    return (
      <React.Fragment>
        <h1>Actores</h1>
        {/* {console.log(props.datos)}  */}
        {props.datosActores.length !== 0
          ? 
          props.datosActores.map((v, i, a) => {
            if(i < 10){
            return (
              <p
                id={v.value.url}
                key={i}
                onClick={() => {
                  props.funcionActores(v.value.url);
                }}
              >
                {v.value.name}
              </p>
            )};
          })
          : ( <p className='alert'>No se han encontrado los Actores de esta película</p>)}
      </React.Fragment>
    );
  }
  
  export default ListaActores;
